INSERT INTO `components_shared_question_answers` VALUES (1,'Do we use Strapi + Next.js for our blog?','**Yes!** Our website, [Strapi](https://strapi.io.io/blog), is using Strapi and Next.js. The logic and architecture of FoodAdvisor was heavily inspired by what has been done for our website.'),(2,'Is this SEO friendly?','**Absolutely!** Based on its flexibility, Strapi will allow you to make you website SEO friendly. You just need to create the necessary fields and data for your frontend to be able to rank well.\nFind some [good practices about SEO](https://strapi.io/blog/headless-cms-strapi-seo-best-practices).'),(3,'Do we use Strapi + Next.js for our blog?','**Yes!** Our website, [Strapi](https://strapi.io.io/blog), is using Strapi and Next.js. The logic and architecture of FoodAdvisor was heavily inspired by what has been done for our website.'),(4,'Is this SEO friendly?','**Absolutely!** Based on its flexibility, Strapi will allow you to make you website SEO friendly. You just need to create the necessary fields and data for your frontend to be able to rank well.\nFind some [good practices about SEO](https://strapi.io/blog/headless-cms-strapi-seo-best-practices).'),(5,'Utilisons-nous Strapi + Next.js pour notre blog?','**Oui !** Notre site web [Strapi](https://strapi.io.io/blog), utilise Strapi et Next.js. La logique et l\'architecture de FoodAdvisor a t fortement inspires de ce qui a t fait pour notre site Web.'),(6,'Est-ce bon pour le SEO ?','**Absolument !** Bas sur sa flexibilit, Strapi vous permettra de rendre votre site web SEO friendly pour le rfrencement. Il vous suffit de crer les champs et les donnes ncessaires pour que votre frontend puisse bien performer dans les rsultats de recherches.\nVoici quelques [bonnes pratiques sur le rfrencement](https://strapi.io/blog/headless-cms-strapi-seo-best-practices).'),(7,'Utilisons-nous Strapi + Next.js pour notre blog?','**Oui !** Notre site web [Strapi](https://strapi.io.io/blog), utilise Strapi et Next.js. La logique et l\'architecture de FoodAdvisor ont t fortement inspires de ce qui a t fait pour notre site Web.'),(8,'Est-ce bon pour le SEO ?','**Absolument !** Bas sur sa flexibilit, Strapi vous permettra de rendre votre site web SEO friendly pour le rfrencement. Il vous suffit de crer les champs et les donnes ncessaires pour que votre frontend puisse bien performer dans les rsultats de recherches. Voici quelques [bonnes pratiques sur le rfrencement](https://strapi.io/blog/headless-cms-strapi-seo-best-practices).'),(9,'What is Strapi?','Strapi is an open-source, Node.js based, [Headless CMS](https://strapi.io/what-is-headless-cms) that saves developers a lot of development time while giving them the freedom to use their favorite tools and frameworks.'),(10,'What are the most popular Strapi use cases?','Traditional use cases include [static websites](https://strapi.io/solutions/static-websites), [mobile apps](https://strapi.io/solutions/mobile-cms), [e-commerce](https://strapi.io/solutions/ecommerce-cms), [editorial](https://strapi.io/solutions/editorial-cms) and [corporate websites](https://strapi.io/solutions/corporate-website-cms). However, you can use Strapi to build any type of content-oriented applications including delivery to portable IoT devices or internal tools.'),(11,'How do I start a Strapi project on my computer?','```npx create-strapi-app my-project --quickstart```\n\nFollow our [documentation](https://strapi.io/documentation/developer-docs/latest/getting-started/quick-start.html#_1-install-strapi-and-create-a-new-project) '),(12,'Can I fully customize FoodAdvisor on my machine?','**Yes!** FoodAdvisor is public on [Github](https://github.com/strapi/foodadvisor). Feel free to fully customize it on your own machine.'),(13,'Is this FAQ part of a dynamic zone?','**Yes!** This FAQ is a component part of a **blocks** category in Strapi. The `Page` collection-type contains a **blocks** dynamic zone that include this FAQ component.\nIt means that I can dynamically insert an infinite number of FAQ in this page '),(14,'Does it mean that I can customize the sections of this page?','**Yes!** Just include the components you want to add to your `Page` collection-type dynamic zone (blocks), add your data and you are good to go!'),(15,'Can I create pages on the fly?','**Absolutely!** The `Page` collection-type allows you to create pages on the fly with a defined list of blocks. Try to create an `/about` page for example '),(16,'Qu\'est-ce que Strapi ?','Strapi est un [Headless CMS](https://strapi.io/what-is-headless-cms) open source, bas sur Node.js qui permet aux dveloppeurs d\'conomiser beaucoup de temps de dveloppement tout en leur donnant la libert d\'utiliser leur outils et framework favoris.'),(17,'Quels sont les cas d\'utilisations les plus populaires ?','Les cas d\'utilisation traditionnels incluent les [sites web statiques](https://strapi.io/solutions/static-websites), [applications mobiles](https://strapi.io/solutions/mobile-cms), [e-commerce]( https://strapi.io/solutions/ecommerce-cms), [blog](https://strapi.io/solutions/editorial-cms) et [sites corporate](https://strapi.io/solutions/corporate-site-cms). Cependant, vous pouvez utiliser Strapi pour crer tout type d\'applications orientes contenu, y compris pour des appareils IoT portables ou  des outils internes.'),(18,'Comment dmarrer un projet Strapi sur mon ordinateur ?','```npx create-strapi-app my-project --quickstart```\n\nSuivez notre [documentation](https://strapi.io/documentation/developer-docs/latest/getting-started/quick-start.html#_1-install-strapi-and-create-a-new-project) '),(19,'Puis-je personnaliser entirement FoodAdvisor sur ma machine ?','**Oui!** FoodAdvisor est public sur [Github](https://github.com/strapi/foodadvisor). N\'hsitez pas  le personnaliser entirement sur votre propre machine.'),(20,'Cette FAQ fait-elle partie d\'une dynamic zone?','**Oui !** Cette FAQ fait partie d\'une catgorie **blocks** dans Strapi. Le Collection-type `Page` contient une dynamic zone **blocks** qui inclut ce composant FAQ.\nCela signifie que vous pouvez insrer dynamiquement un nombre infini de FAQ sur cette page '),(21,'Cela signifie-t-il que je peux personnaliser les sections de cette page?','**Oui !** Incluez simplement les composants que vous souhaitez ajouter  votre dynamic zone de votre Collection-type `Page` (blocks), ajoutez vos donnes et vous tes prt c\'est partie !'),(22,'Puis-je crer des pages  la vole ?','**Absolument !** Le Collection-Type `Page` vous permet de crer des pages  la vole avec une liste dfinie de composants. Essayez de crer une page `/about` par exemple '),(23,'Puis-je personnaliser entirement FoodAdvisor sur ma machine ?','**Oui!** FoodAdvisor est public sur [Github](https://github.com/strapi/foodadvisor). N\'hsitez pas  le personnaliser entirement sur votre propre machine.'),(24,'Cette FAQ fait-elle partie d\'une dynamic zone?','**Oui !** Cette FAQ fait partie d\'une catgorie **blocks** dans Strapi. Le Collection-type `Page` contient une dynamic zone **blocks** qui inclut ce composant FAQ.\nCela signifie que vous pouvez insrer dynamiquement un nombre infini de FAQ sur cette page '),(25,'Cela signifie-t-il que je peux personnaliser les sections de cette page?','**Oui !** Incluez simplement les composants que vous souhaitez ajouter  votre dynamic zone de votre Collection-type `Page` (blocks), ajoutez vos donnes et vous tes prt c\'est partie !'),(26,'Puis-je crer des pages  la vole ?','**Absolument !** Le Collection-Type `Page` vous permet de crer des pages  la vole avec une liste dfinie de composants. Essayez de crer une page `/about` par exemple '),(27,'Puis-je personnaliser entirement FoodAdvisor sur ma machine ?','**Oui!** FoodAdvisor est public sur [Github](https://github.com/strapi/foodadvisor). N\'hsitez pas  le personnaliser entirement sur votre propre machine.'),(28,'Cette FAQ fait-elle partie d\'une dynamic zone?','**Oui !** Cette FAQ fait partie d\'une catgorie **blocks** dans Strapi. Le Collection