AQ fait partie d\'une catgorie **blocks** dans Strapi. Le Collection-type `Page` contient une dynamic zone **blocks** qui inclut ce composant FAQ.\nCela signifie que vous pouvez insrer dynamiquement un nombre infini de FAQ sur cette page '),(85,'Cela signifie-t-il que je peux personnaliser les sections de cette page?','**Oui !** Incluez simplement les composants que vous souhaitez ajouter  votre dynamic zone de votre Collection-type `Page` (blocks), ajoutez vos donnes et vous tes prt c\'est partie !'),(86,'Puis-je crer des pages  la vole ?','**Absolument !** Le Collection-Type `Page` vous permet de crer des pages  la vole avec une liste dfinie de composants. Essayez de crer une page `/about` par exemple '),(87,'Puis-je personnaliser entirement FoodAdvisor sur ma machine ?','**Oui!** FoodAdvisor est public sur [Github](https://github.com/strapi/foodadvisor). N\'hsitez pas  le personnaliser entirement sur votre propre machine.'),(88,'Cette FAQ fait-elle partie d\'une dynamic zone?','**Oui !** Cette FAQ fait partie d\'une catgorie **blocks** dans Strapi. Le Collection-type `Page` contient une dynamic zone **blocks** qui inclut ce composant FAQ.\nCela signifie que vous pouvez insrer dynamiquement un nombre infini de FAQ sur cette page '),(89,'Cela signifie-t-il que je peux personnaliser les sections de cette page?','**Oui !** Incluez simplement les composants que vous souhaitez ajouter  votre dynamic zone de votre Collection-type `Page` (blocks), ajoutez vos donnes et vous tes prt c\'est partie !'),(90,'Puis-je crer des pages  la vole ?','**Absolument !** Le Collection-Type `Page` vous permet de crer des pages  la vole avec une liste dfinie de composants. Essayez de crer une page `/about` par exemple '),(91,'How this demo globally works?','This demo contains two applications: A Strapi and a Next.js one. The content is created and delivered by Strapi. On the other side, this Next.js application simply fetch the data from Strapi and display it right here. Next.js is using [SSR](https://nextjs.org/docs/basic-features/pages#server-side-rendering) to fetch the data (need to reload to see content updates from Strapi) but you can absolutety use SSG, this is what we do on our [strapi.io](https://strapi.io) website '),(92,'Is there some customizations just for this demo?','**Yes**! In fact, please find the list below of the customizations that have been done for the purpose of this demo. **These customizations won\'t be there in a default project** but it is very easy to have them:\n\nThe following plugins were added: [SEO](https://market.strapi.io/plugins/@strapi-plugin-seo), [Sitemap](https://market.strapi.io/plugins/strapi-plugin-sitemap), [Calendar](https://market.strapi.io/plugins/@offset-dev-strapi-calendar), [Scheduler](https://market.strapi.io/plugins/@webbio-strapi-plugin-scheduler), [Cookie Manager](https://market.strapi.io/plugins/strapi-plugin-cookie-manager), [strapi-plugin-populate-deep](https://market.strapi.io/plugins/strapi-plugin-populate-deep), [Todo](https://market.strapi.io/plugins/strapi-plugin-todo)\n\nAlso, a [Ckeditor 5 custom field](https://github.com/ckeditor/strapi-plugin-ckeditor) has been added to the `article` content type for writing the content of it.\n\n 4 admin extensions were added: \n  - **Publication Workflow System workaround** allowing you to track publication events of the article content-type. Learn more [about it](https://github.com/strapi/foodadvisor/tree/master/api#publication-workflow)\n  - **A draft filter button** which should work in combination with the Publication Workflow System. This is a button that will appear as an editor/author in the article listView allowing you to directly filters through the articles that needs a review/needs changes. It is using the PublicationStage field. Pretty useful when you regularly have to filters your content by just a click.\n  - **A Preview button**. Only working with the Next.js preview system, this button will appear on your restaurants, articles, and pages editView in the right section allowing you to preview them on your front-end.\n  - **A Tweet button**. This button will appear on your restaurants, and articles editView in the right section allowing you to share a tweet about this conte'),(93,'How many components can we nest in Strapi?','Using the UI, you can nest 2 components only. However, by directly modifying the JSON file of the parent component, you can nest way more! This is not something we encourage to do but this is possible. In fact, the `footer` component of the Global single-type contains a `footerColumns` component that itself contains a `links` repeatable component '),(94,'What if something is broken on Next.js?','Strapi is an headless CMS. It is completely dissociated from the front-end application which is Next.js here. Everything can work like a charm on the Strapi side but not on the front-end side, and vice-versa. There could have been an infinite number of possible Next.js application fetching the data of this Strapi application and some of them would have been better than some others. \nThis front-end app is not perfect, but simple enough to demonstrate how a simple client application can work with Strapi.\n\nIf you face any issues during your demo trial, please, feel free to [submit a GitHub issue to the project](https://github.com/strapi/foodadvisor/issues).'),(95,'What if my demo is slow?','If you requested a demo on our [website](https://strapi.io/demo) it is normal. Compared to what we can see in our ecosystem, we want to deliver a unique demo for everyone so that they can personalize it as much as they want. However, these demos run on the cloud with **limited resources** ');
